monument.description:
Sechsgeschossiger Putzbau inkl. Ateliergeschoss;
			errichtet im Zuge des hannoverschen Stadterweiterungskonzeptes nach
			dem Ersten Weltkrieg; beispielhafte Anlage für verdichtetes Bauen in
			der Tradition des "Neuen Bauens" erb. 1929-31 von A. Falke;

fünfgeschossiger Putzbau unter Walmdach in städtebaulich
			prägender Ecklage; Erdgeschoss als Ladengeschoss dienend;
			Rhythmisierung der Fassade durch kielförmige Fenstererker;
			gleichzeitig Lister Kirchweg 112; Entwurf Brüder Siebrecht und
			Mackensen & Torno
